import React from "react";

const About = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h1>About</h1>
      <p>
        This job portal is built with React, React Router, and Axios as part of
        INFO6150 Assignment 9.
      </p>
    </div>
  );
};

export default About;
